import React, { useState } from "react";
import "./JobSeekerDashboard.css";

const JobSeekerDashboard = () => {
  const [applications, setApplications] = useState([
    {
      id: 1,
      jobTitle: "Software Engineer",
      company: "Tech Corp",
      status: "Pending",
    },
    {
      id: 2,
      jobTitle: "Data Analyst",
      company: "Data Inc.",
      status: "Interview Scheduled",
    },
  ]);

  const [savedJobs, setSavedJobs] = useState([
    { id: 1, jobTitle: "UI/UX Designer", company: "Creative Studio" },
    { id: 2, jobTitle: "Product Manager", company: "Business Hub" },
  ]);

  const profile = {
    name: "John Doe",
    email: "johndoe@example.com",
    resumeLink: "https://example.com/resume",
  };

  return (
    <div className="dashboard">
      <h1>Job Seeker Dashboard</h1>

      {/* Profile Section */}
      <div className="profile">
        <h2>Your Profile</h2>
        <p>
          <strong>Name:</strong> {profile.name}
        </p>
        <p>
          <strong>Email:</strong> {profile.email}
        </p>
        <a
          href={profile.resumeLink}
          target="_blank"
          rel="noopener noreferrer"
          className="resume-link"
        >
          View Resume
        </a>
      </div>

      {/* Applications Section */}
      <div className="applications">
        <h2>Your Applications</h2>
        {applications.length > 0 ? (
          <ul>
            {applications.map((application) => (
              <li key={application.id}>
                <div>
                  <strong>{application.jobTitle}</strong> at{" "}
                  {application.company}
                </div>
                <span
                  className={`status ${application.status
                    .toLowerCase()
                    .replace(" ", "-")}`}
                >
                  {application.status}
                </span>
              </li>
            ))}
          </ul>
        ) : (
          <p>No applications found.</p>
        )}
      </div>

      {/* Saved Jobs Section */}
      <div className="saved-jobs">
        <h2>Saved Jobs</h2>
        {savedJobs.length > 0 ? (
          <ul>
            {savedJobs.map((job) => (
              <li key={job.id}>
                <div>
                  <strong>{job.jobTitle}</strong> at {job.company}
                </div>
                <button
                  onClick={() =>
                    setSavedJobs(
                      savedJobs.filter((savedJob) => savedJob.id !== job.id)
                    )
                  }
                >
                  Remove
                </button>
              </li>
            ))}
          </ul>
        ) : (
          <p>No saved jobs found.</p>
        )}
      </div>
    </div>
  );
};

export default JobSeekerDashboard;
